import React, { Component } from 'react';
import covidTesting from '../back-end/covidTesting.js';

class CovidTesting extends Component {
    async componentDidMount() {
        const covidTestingTest = await covidTesting.methods.isCivillianTested();

        console.log(covidTestingTest);
    }

    render() {
        return <div>
            Covid Testing Index!
        </div>
    }
}

export default CovidTesting;
